import React from "react";
import CardItem from "./CardItems";


function Card() {
  const Cardx = ({ imageUrl, title, description }) => {
    return (
      <div style={styles.card}>
        <div style={styles.cardImageContainer}>
          <img style={styles.cardImage} src={imageUrl} alt={title} />
        </div>
        <div style={styles.cardContent}>
          <h3>{title}</h3>
          <p>{description}</p>
        </div>
      </div>
    );
  };

  const styles = {
    card: {
      display: "flex",
      flexDirection: "row",
      justifyContent: "space-between",
      alignItems: "center",
      backgroundColor: "#6E44FF",
      color: "#FFFFFF",
      padding: "20px",
      borderRadius: "10px",
      boxShadow: "0px 2px 6px rgba(0, 0, 0, 0.25)",
    },
    cardImageContainer: {
      width: "40%",
    },
    cardImage: {
      width: "100%",
      height: "auto",
      borderRadius: "5px",
    },
    cardContent: {
      width: "55%",
      textAlign: "right",
    },
  };
  const cards = [
    {
      imageUrl:
        "https://via.placeholder.com/300x200.png?text=Card+1+Image",
      title: "Card 1 Title",
      description: "Card 1 Description",
    },
    {
      imageUrl:
        "https://via.placeholder.com/300x200.png?text=Card+2+Image",
      title: "Card 2 Title",
      description: "Card 2 Description",
    },
    {
      imageUrl:
        "https://via.placeholder.com/300x200.png?text=Card+3+Image",
      title: "Card 3 Title",
      description: "Card 3 Description",
    },
    {
      imageUrl:
        "https://via.placeholder.com/300x200.png?text=Card+4+Image",
      title: "Card 4 Title",
      description: "Card 4 Description",
    },
    {
      imageUrl:
        "https://via.placeholder.com/300x200.png?text=Card+5+Image",
      title: "Card 5 Title",
      description: "Card 5 Description",
    },
    {
      imageUrl:
        "https://via.placeholder.com/300x200.png?text=Card+6+Image",
      title: "Card 6 Title",
      description: "Card 6 Description",
    },
  ];
  return (
  <div style={{padding:"100px"}}> 
   <div>
    {cards.map((card) => (
      <Cardx
        key={card.title}
        imageUrl={card.imageUrl}
        title={card.title}
        description={card.description}
      />
    ))}
    </div>
    <div className="row">
      <div className="col-md-6">
        <div className="card" style={{display:"flex"}}>
           <div>SaksÄ±</div>
          <div><img className="card-img-top" src="/images/orkide.png" alt=""/></div>
        </div>
      </div>
      <div className="col-md-6">
        <div className="card">
          <image className="card-img-top"  src="/images/renkarka.png" alt="Card image cap" />
        </div>
      </div>
    </div>

  </div>
  );
}

export default Card;
